import React from 'react'

 const ModalLogin = ({showUser}) => {
    if (!showUser) {
        return null;
      }
    return (
        <div className="modal">
        <div className="modal-content">
          <div className="modal-header">
            <div className="modal-body">
              <h3 className="parageraph p-title" > {` کاربر ${showUser[0].email} کاربر `} </h3>
            
            </div>
          </div>
        </div>
      </div>
    )
}
export default ModalLogin;
